import React from 'react'
import Toolbar from '../Toolbar/Toolbar'
const LandingPage = () => {
    return (
        <div className="landing-container">
            <Toolbar />
            <main style={{marginTop: '64px'}}>
            <p>this is the page content</p>
            </main>
          
        </div>
    )
}

export default LandingPage;
